import './App.css';
import React from "react";
import Navbar from './components/Navbar';
import TableI from './components/table';
import 'logo.svg';


function App() {
  return (
    <div> 
      <nav className="navbar navbar-dark bg-dark"> 
      <img src='logo.svg'></img>
      </nav>
      <Navbar/> 
      <TableI />
    </div>
  );
}

export default App;
